def main():
    rr = []

    def f(s):
        d = collections.defaultdict(int)
        ac = {}
        ca = {}
        for i in range(26):
            t = int(2**i)
            c = chr(ord('a') + i)
            ac[t] = c
            ca[c] = t
        a = [ca[c] for c in s]
        z = ca['z']
        d[0] = 1
        for c in a:
            nd = collections.defaultdict(int)
            c2 = c * 2
            for k,v in d.items():
                if k & c or c == 1:
                    nd[k] += v
                if c != z and k & c2 == 0:
                    nd[k|c2] += v
            d = nd
        r = [sum(d.values())]

        ss = set([''])
        for t in s:
            ns = set()
            t2 = chr(ord(t) + 1)
            for si in ss:
                if t in si or t == 'a':
                    ns.add(si + t)
                if t != 'z' and t2 not in si:
                    ns.add(si + t2)
            ss = set(sorted(ns)[:5])
        rs = ss

        ss = set([''])
        for t in s:
            ns = set()
            t2 = chr(ord(t) + 1)
            for si in ss:
                if t in si or t == 'a':
                    ns.add(si + t)
                if t != 'z' and t2 not in si:
                    ns.add(si + t2)
            ss = set(sorted(ns, reverse=True)[:5])
        rs |= ss
        r.extend(sorted(rs))

        return r

    while True:
        s = S()
        if s == '#':
            break
        rr.extend(f(s))

    return '\n'.join(map(str, rr))

print(main())

